import React from "react";
// import Navbar from "./navbar";
import MiddleText from "./middleContainer";
import CopyrightsText from "./copyrights";
import Scripts from "./bottomContainer";
import Header from "./header";
import $ from "jquery";
import Script from "react-inline-script"

function Home() {

  return (
    <div className="Home">
      <Header></Header>

      <Script>

        {
          $(document).ready(function () {
            $(document).fadeOut(10);
            $(document).fadeIn();
          })
        }

      </Script>

      <MiddleText></MiddleText>
      <CopyrightsText></CopyrightsText>
      <Scripts></Scripts>
    </div>
  );
}

export default Home;
